ul.li:
In column 2 (Borger Value(s)), the name given to each sign follow's Borgers's second chapter, with some minor typographic variations to conform with ATF's compound sign-naming conventions. For instance: 


component signs that appear over each other are connected with &; 

signs that are crossing (Borger: "gekreuzt") are connected with %; 

signs that confront (Borger: "SIGN.SIGNinversum") each other are connected with @; 

and signs that are squared (Borger: "4mal", four times) are preceded by 4×. 

Where Borger uses hyphens, we write full stops;

but inside signs, Borger's hyphens are our + signs (e.g., Borger's "KA× AD-KUG" is ATF KA×AD+KUG);

where he writes SIGNgunû, SIGNšeššig, SIGNtenû, we write SIGN@g, SIGN@s, SIGN@t.
